import styled from 'styled-components'

export const StyledButton = styled.button`
	cursor: pointer;
	margin: 1rem 0;
`
export const StyledContent = styled.div`
	height: 100%;
	width: 100%;
	display: flex;
	justify-content: space-between;
`
